import React from 'react';
import SkillsCard from '../components/SkillsCard';
import { Container } from 'react-bootstrap';
import Layout from '../components/Layout';
import MyCard from '../components/StyledCard';
import StyledContainer from '../components/StyledContainer';

const lang = {
    "title" : "Programming Languages",
    "items" : [
        "Scala",
        "Python",
        "Javascript",
        "TypeScript",
        "C",
        "C++",
        "Java"
    ]
}
const cs = {
    "title" : "Computer Science Topics",
    "items" : [
        "Concurrency / Synchronization (Sempaphores & mutexes)",
        "Object-Orientated Techniques",
        "Pointers / Pointer arithmetic",
        "Memory Allocation / Management",
    ]
}
const math = {
    "title" : "Math Skills",
    "items" : [
        "Calculus",
        "Linear Algebra",
        "Probability Theory"
    ]
}
const web = {
    "title" : "Web Technologies",
    "items" : [
        "HTML",
        "CSS",
        "Responsive Design",
        "Form Validation",
        "BootStrap",
        "React",
        "Django (Python)",
        "Web Sockets",
        "API Usage",
        "Node JS",
        "HTTP Requests",
        "Ajax",
    ]
}
const db = {
    "title" : "Relational Databases",
    "items" : [
        "MySQL",
        "Postgresql",
    ]
}
const Skills : React.FunctionComponent<{}> = () => {
    return (
        <Layout page="skills">
        <StyledContainer>
            <h1>Skills</h1>
            <MyCard header={lang.title} items={lang.items}/>
            <MyCard header={web.title} items={web.items}/>
            <MyCard header={cs.title} items={cs.items}/>
            <MyCard header={db.title} items={db.items}/>
            <MyCard header={math.title} items={math.items}/>
        </StyledContainer>
        </Layout>
    )
}

export default Skills;
